import { AddCard } from './AddCard'
import { service } from '../service/graphql'
import { AddTopic } from './AddTopic'
import { GetTopic } from './GetTopic'
import { GetTopics } from './GetTopics'
import { GetTopicsObserver } from './GetTopicsObserver'
import { RemoveTopic } from './RemoveTopic'

const addCard = new AddCard(service)
const addTopic = new AddTopic(service)
const getTopic = new GetTopic(service)
const getTopics = new GetTopics(service)
const getTopicsObserver = new GetTopicsObserver(service)
const removeTopic = new RemoveTopic(service)

export { addCard, addTopic, getTopic, getTopics, getTopicsObserver, removeTopic }
